description:
&quot;Laura and Rich return from plunge to the ocean floor&quot;

Jeffrey Reiner   Darcy Meyers                                November 28, 2005



Laura and Rich are in for another shock when they leave the ocean floor and return to the surface where they find Jackson gone and are trapped on a sinking raft before they are eventually rescued by a helicopter. Meanwhile, Savannah suspects that Nimrod's responsible for Miles ending up in the hospital. Miles nearly dies before Nimrod unexpectedly heals him, but security kills Nimrod.
